import imageIcon from "../logo.jpg";
import styled from "styled-components";

export const Footer = () => {
  return (
    <FooterWrapper>
      <div>
        <img src={imageIcon} className="logoImage" />
      </div>
      <div>
        <a href="https://www.themoviedb.org/">https://www.themoviedb.org/</a>
      </div>
    </FooterWrapper>
  );
};

const FooterWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px;
  height: 30px;

  a {
    text-decoration: none;
    color: white;
    font-size: 10px;
  }
  .logo {
    font-weight: 600;
    font-size: 18px;
  }
`;
